text-align:left;
font-size: 14px">斉藤先生のぐんぐんウォーク テーピングスパッツ　【10分丈タイプ】</h1>
　
<table width="550" border="0" cellpadding="0" cellspacing="0" align="center" style="line-height:1.7;font-size:13px;">
  <tr>
    <td width="550"><img src="http://image.rakuten.co.jp/mckey/cabinet/navy/5492detd110502-01.jpg" alt="テーピングのプロの技術が生んだグングンウォーク テーピングスパッツ" width="550" height="729"><br>
      <br>  
        <strong style="color:#0080BD;font-size:15px;">斎藤先生のぐんぐんウォーク テーピングスパッツ<br>
        10分丈タイプ</strong><br>
        筋肉の流れに沿って配置されたパワーテーピングが、下半身をキュッと引き締めて歩行を安定させます。いつもより楽に動けてシェイプアップ。ウエストから足首まで段階的に着圧することで余計な揺れを抑えます。普段のお買い物や、通勤・通学、自宅での家事仕事でもお使い頂けます。色はブラック（黒）とベージュ（肌色）、サイズはM（ヒップ85～98cm）、L（90～103cm）を用意しております。<br>
        <br>
        <br>
        <strong style="color:#0080BD;font-size:15px;">ぐんぐんウォークステーピングパッツの7つのサポート！</strong><BR>
            （１）ヒップアップ<br>
            お尻のお肉を押し上げるようにテーピング。<br>
            <br>
            （２）腰が楽に動くようサポート<br>
腰をカバーする幅広ゴム編みと、腸骨を安定させるテーピング編みで、<br>
左右のブレによる負担を軽減します。<br>
            <br>
            （３）下腹サポート<br>
腰下腹のお肉をVの宇のように引き締めるテーピングでサポートします。<br>
<br>
（４）下脚がラクに上がるようサポート<br>
太ももの内側と外側を大腿四頭筋に沿ってサポートすることで、<br>
筋肉の縮む力を補助し運動時に負担を軽減します。<br>
<br>
（５）膝がラクに動くよう内側側副靭帯をサポート<br>
左右のブレを軽減するように内側側副靭帯をサポートします。<br>
<br>
（６）膝がラクに動くよう内側側副靭帯をサポート<br>
ひざの動きに合わせて伸縮し、膝骸骨(しがいこつ)ひざの皿を下から<br>
手で支えるように設計された三日月型テープ編みを採用。<br>
<br>
（７）ふくらはぎのツリを予防するようにサポート<br>
ふくらはぎの筋肉(前脛骨筋と腓腹筋)のバランスを保つようにサポートすることで
<br>
ふくらはぎのツリを予防して、運動による負担を軽減します。
<br>
<BR>
            <table border="0" cellspacing="0" cellpadding="0" style="line-height:1.7;font-size:13px;">
              <tr>
                <td width="278" valign="top"><strong style="color:#0080BD;font-size:15px;">テーピングトレーナー <br>
                齋藤 隆正先生</strong><br>
                歩くための筋肉をサポートして、ラクに動くようにテーピング編みを設計。テーピングは筋肉や骨の動きをサポートする目的で使用します。かるい力でテーピングを継続することでスポーツだけではなく日々の生活にも役立ちます。スポーツ選手のテーピングを手がけて20年以上の技術を生かし、生活用のテーピングも指導。</td>
                <td width="272" align="right"><img src="http://image.rakuten.co.jp/mckey/cabinet/navy/5492detd110502-02.jpg" alt="齋藤 隆正先生" width="262" height="291"></td>
